pragma solidity ^0.8.17;

import {Strings} from "@openzeppelin/contracts/utils/Strings.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {ERC1155} from "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

error MintedOut();
error MintNotActive();
error AlreadyMinted();
error TransferFailed();
error InvalidBuyPrice();
error TokenDoesNotExist();
error ContractsNotAllowedToMint();

contract BasicIslandGenesis is ERC1155, Ownable {
    using Strings for uint256;

    string private _baseURI;
    bool private _mintOpen;

    string public name = "Basic Island Genesis";
    string public symbol = "DESC";

    uint256 private _mintCount;
    uint256 public _mintPrice = 250 * 10**18; //250 matic

    uint256 private constant ID = 1;
    uint256 private constant RESERVE = 10;
    uint256 private constant MAX_PER_WALLET = 2;
    uint256 private constant MAX_SUPPLY = 500;

    mapping(address => uint256) private _amountMinted;

    modifier allowedToMint(uint256 amount) {
        if (!_mintOpen) revert MintNotActive();
        if (msg.value < _mintPrice * amount) revert InvalidBuyPrice();
        if (_amountMinted[msg.sender] + amount > MAX_PER_WALLET)
            revert AlreadyMinted();
        if (_mintCount + amount > MAX_SUPPLY) revert MintedOut();
        if (msg.sender != tx.origin) revert ContractsNotAllowedToMint();
        _;
    }

    constructor(string memory uri_, address addr) ERC1155(uri_) {
        _baseURI = uri_;
        _mint(addr, ID, RESERVE, "");
        _mintCount = RESERVE;
    }

    ///@notice mint and sends the token to the callers address
    function mint(uint256 amount) external payable allowedToMint(amount) {
        _amountMinted[msg.sender] += amount;
        _mintCount += amount;
        _mint(msg.sender, ID, amount, "");
    }

    /// @notice Toggle mint on and off
    function toggleMint() external onlyOwner {
        !_mintOpen ? _mintOpen = true : _mintOpen = false;
    }

    ///@notice changes the mint price
    function changeMintPrice(uint256 mintPrice) external onlyOwner {
        _mintPrice = mintPrice;
    }

    /// @return total Basic Island Nft minted so far for token id 1
    function totalAmountMinted() external view returns (uint256) {
        return _mintCount;
    }

    ///@return the amount to token minted by account
    function amountMinted(address account) external view returns (uint256) {
        return _amountMinted[account];
    }

    /// @return _mintActive true if mint is active and vice versa
    function getState() external view returns (bool) {
        return _mintOpen;
    }

    /// @return tokenUri
    function uri(uint256 id) public view override returns (string memory) {
        if (id != ID) revert TokenDoesNotExist();
        return string(abi.encodePacked(_baseURI, Strings.toString(id)));
    }

    ///@notice withdraws the matic in the contract to _addr
    function withdrawal() external onlyOwner {
        uint256 balance = address(this).balance;
        (bool success, ) = payable(msg.sender).call{value: balance}("");
        if (!success) revert TransferFailed();
    }
}
